import React from 'react';

const nightModeDetails = () => {
    // const _currentPage = document.querySelector('registration');
    const _registrationH1 = ReactDOM.findDOMNode.querySelector('.registration h1');
    const _loginA = document.querySelector('.login a');

    _registrationH1.style.color = 'white';
    _loginA.style.color = 'white';
};

export { nightModeDetails };
